import { combineReducers } from "redux";
import users from "./users/reducer";

const rootReducer = combineReducers({
    users,
    tokenregistro,
    versionmotor,
    datosmotor,
    vehiculoseleccionado,
    datosproducto,
    datosproductouno,
    ubicarproducto,
    variablesgeneralesmrp
});

export default rootReducer;
